import React from 'react';
import { Button } from 'react-bootstrap';
import '../styles/MainBanner.css';
import dog1 from '../images/dogs/dog1.jpg'; // Import additional images as needed
import cat1 from '../images/cats/cat1.jpg';
import parrot1 from '../images/birds/parrot1.jpg';
import greenarowana1 from '../images/fishes/greenarowana1.jpeg';
const MainBanner = () => {
  return (
    <div className="image-banner-container">
      <div className="photo-section">
        <img src={cat1} alt="Cat 1" className="banner-image" />
      </div>
      <div className="photo-section">
        <img src={dog1} alt="Dog 1" className="banner-image" />
      </div>
      <div className="photo-section">
        <img src={parrot1} alt="parrot 1" className="banner-image" />
      </div>
      <div className="photo-section">
        <img src={greenarowana1} alt="fish 1" className="banner-image" />
      </div>
      <div className="photo-section">
        <img src={dog1} alt="Dog 1" className="banner-image" />
      </div>
      <div className="photo-section">
        <img src={dog1} alt="Dog 1" className="banner-image" />
      </div>
      {/* Repeat for more images */}
    </div>
  );
};

export default MainBanner;
